Description: It's Scooby-Doo's most fang-tastic mystery ever - and one hairy experience for Shaggy - when Count Dracula zaps Scooby-Doo and Shaggy to Transylvania in this ghoul-filled movie adventure.

In order to enter a car in the eagerly awaited Monster Car Race, Count Dracula transforms Shaggy into a fuzzy-faced werewolf and forces him to drive in a cross-country race held on the world's creepiest course. In order for Shaggy to return to normal, he and Scooby-Doo must outwit Dracula and out run a horrific horde of frightful funny cars driven by a spine-tingling assortment of celebrity monsters.



